import React from "react";

const NotFound = () => {
    const style = {
        position: "fixed",
        width: "100%",
        height: "100%",
        background: "red",
    };
    return (
        <div className="page_not_found" style={style}>
            <h1>page not found</h1>
        </div>
    );
};

export default NotFound;
